import React from 'react';

import { Jumbotron, Button, OverlayTrigger, Popover } from 'react-bootstrap';
import { Grid, Image, Header } from 'semantic-ui-react';

import Footer from '../Footer';

import Flash from "react-reveal/Flash";

import "../css/Services.css";
import '../../App.css';


const Services = () => {
  return (
  	<>
  		<Head />
  		<SectionOne />
  		<SectionTwo />
  		<Footer />
  	</>
  );
}

const popover = (
  <Popover id="popover-basic">
    <Popover.Title as="h3">No FEAR</Popover.Title>
    <Popover.Content>
      We accept any challenge! Let us know what you need, and watch it get done!
    </Popover.Content>
  </Popover>
);

const Head = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<h1>OUR SERVICES</h1>
				    <p>
				    	We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <span className="flashCont"><Flash><OverlayTrigger trigger="hover" placement="right" overlay={popover}><span className="contactLink">contact</span></OverlayTrigger></Flash></span> us to maek ararngements.
				    </p>

	  				<p>
	    				<Button variant="primary">Make it Happen</Button>
	  				</p>
				</Jumbotron>
			</div>
		</>
	)
}

const SectionOne = () => {
	return (
		<div className="service1">
			<Grid columns={2} divided padded>
				<Grid.Row>
					<Grid.Column>
						<Image src='https://images.pexels.com/photos/1789968/pexels-photo-1789968.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500' />
					</Grid.Column>
					<Grid.Column>
						<Header as="h2">Web App Development</Header>
						<p>Rapid development of single page web apps, static websites or complete CMS systems</p>
					</Grid.Column>
				</Grid.Row>

				<Grid.Row>
					<Grid.Column>
						<Header as="h2">Graphic Design</Header>
						<p>Creating of Logos, Pamphlets, Technical Diagrams or any other Graphic Design Requirements.</p>
					</Grid.Column>
					<Grid.Column>
						<Image src='https://images.pexels.com/photos/267350/pexels-photo-267350.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500' />
					</Grid.Column>
				</Grid.Row>
			</Grid>
		</div>
	)
}

const SectionTwo = () => {
	return (
		<div className="service2">

		</div>
	)
}

export default Services;
